<script type="text/javascript">

$(document).ready( function() {
  $( ".circle" ).animate({
    left: "+=2400",
    top: "+=2400",
  }, 15000, function() {
  });
  
  // setInterval(paint_circles, 300)
  // setInterval(change_circles_size, 10)
  // change_circles_size()

  function paint_circles() {
  	$(".circle").each(function() {
  	if(Math.random() > 0.5) $(this).css({"background":"red"})
  		else $(this).css({"background":"black"})
  })
  }

  function change_circles_size() {
  	$(".circle").each(function() {
  		var increment = 2
  		if(Math.random() < 0.5) increment = -2
  		var new_value = parseInt ( $(this).css("border-radius") ) + increment + "px"
  		
  		$(this).css({"border-radius":new_value})
  // 		$( this ).animate({
  //   width: "+=20",
  //   height: "+=20"
  // }, 10000, function() {
  // });

  })
  }


  

}) // end of document ready

</script>
